import './Admission.css';
import { useState } from 'react';

function Admission() {
  const [formData, setFormData] = useState({
    fullName: '',
    fatherName: '',
    motherName: '',
    gender: '',
    email: '',
    phone: '',
    dob: '',
    aadhar: '',
    course: '',
    category: '',
    address: '',
    city: '',
    pincode: '',
    state: '',
    qualification: '',
    photo: '',
    signature: ''
  });

  const generateEnrollment = () => {
    return 'ENR' + Date.now().toString().slice(-8);
  };

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    if (files) {
      const reader = new FileReader();
      reader.onload = () => {
        setFormData((prev) => ({ ...prev, [name]: reader.result }));
      };
      reader.readAsDataURL(files[0]);
    } else {
      setFormData((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const saved = JSON.parse(localStorage.getItem('admissionForms')) || [];
    const alreadyExists = saved.some(
      (entry) => entry.email === formData.email && entry.course === formData.course
    );
    if (alreadyExists) return alert("Admission already exists with this email and course");

    const newEntry = {
      ...formData,
      enrollment: generateEnrollment()
    };

    const updated = [...saved, newEntry];
    localStorage.setItem('admissionForms', JSON.stringify(updated));
    alert(`Admission submitted! Your Enrollment No. is: ${newEntry.enrollment}`);

    setFormData({
      fullName: '', fatherName: '', motherName: '', gender: '', email: '', phone: '', dob: '', aadhar: '', course: '',
      category: '', address: '', city: '', pincode: '', state: '', qualification: '', photo: '', signature: ''
    });
  };

  return (
    <div className="admission">
      <h1>Advanced Admission Form</h1>
      <form className="admission-form" onSubmit={handleSubmit}>
        <label>Full Name</label>
        <input type="text" name="fullName" value={formData.fullName} onChange={handleChange} required />

        <label>Father's Name</label>
        <input type="text" name="fatherName" value={formData.fatherName} onChange={handleChange} required />

        <label>Mother's Name</label>
        <input type="text" name="motherName" value={formData.motherName} onChange={handleChange} required />

        <label>Gender</label>
        <select name="gender" value={formData.gender} onChange={handleChange} required>
          <option value="">-- Select Gender --</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Other">Other</option>
        </select>

        <label>Date of Birth</label>
        <input type="date" name="dob" value={formData.dob} onChange={handleChange} required />

        <label>Aadhar Number</label>
        <input type="text" name="aadhar" value={formData.aadhar} onChange={handleChange} required />

        <label>Email</label>
        <input type="email" name="email" value={formData.email} onChange={handleChange} required />

        <label>Phone</label>
        <input type="tel" name="phone" value={formData.phone} onChange={handleChange} required />

        <label>Course Applying For</label>
        <select name="course" value={formData.course} onChange={handleChange} required>
          <option value="">-- Select Course --</option>
          <option value="BCA">BCA</option>
          <option value="MCA">MCA</option>
          <option value="BBA">BBA</option>
          <option value="MBA">MBA</option>
          <option value="B.Com">B.Com</option>
          <option value="M.Com">M.Com</option>
          <option value="B.Sc. CS">B.Sc. CS</option>
          <option value="M.Sc. CS">M.Sc. CS</option>
          <option value="B.Sc. IT">B.Sc. IT</option>
          <option value="M.Sc. IT">M.Sc. IT</option>
          <option value="B.A.">B.A.</option>
          <option value="M.A.">M.A.</option>
        </select>

        <label>Category</label>
        <select name="category" value={formData.category} onChange={handleChange} required>
          <option value="">-- Select Category --</option>
          <option value="General">General</option>
          <option value="OBC">OBC</option>
          <option value="SC">SC</option>
          <option value="ST">ST</option>
        </select>

        <label>Highest Qualification</label>
        <input type="text" name="qualification" value={formData.qualification} onChange={handleChange} required />

        <label>Address</label>
        <textarea name="address" rows="3" value={formData.address} onChange={handleChange} required></textarea>

        <label>City</label>
        <input type="text" name="city" value={formData.city} onChange={handleChange} required />

        <label>State</label>
        <input type="text" name="state" value={formData.state} onChange={handleChange} required />

        <label>Pincode</label>
        <input type="text" name="pincode" value={formData.pincode} onChange={handleChange} required />

        <label>Upload Photograph</label>
        <input type="file" name="photo" accept="image/*" onChange={handleChange} required />

        <label>Upload Signature</label>
        <input type="file" name="signature" accept="image/*" onChange={handleChange} required />

        <button type="submit">Submit Admission</button>
      </form>
    </div>
  );
}

export default Admission;
